    const [showSearch, setShowSearch] = useState(false);
  return (
    <div className = 'banner' >
        <div className='banner__search'>
            {showSearch && <Search />}
          <Button onClick={() => setShowSearch(!showSearch)}
          className='banner__searchButton'
          variant='outlined'>Search Dates</Button>  
