       <div className= 'banner__info'>
           <h1>Find places to stay on Airbnb</h1>
           <h5>Discover entire homes and private rooms perfect for any trip.</h5>
            <Button variant='outlined' >Explore Nearby</Button>
        </div>
    </div>
  )
}

